import React from 'react'
import Checkbox from '../../../components/Checkbox/Checkbox'
import AddTask from '../../../components/AddTask/AddTask'


export default class App extends Component {
    render() {
        return (
            <div className='Main'>
                <h1>Today</h1>
                <Checkbox value={'Привет'} id={1} important={true}/>
                <Checkbox value={'Это мой'} id={2} important={false}/>
                <Checkbox value={'Тест'} id={3} important={false}/>
                <AddTask />
            </div>
        )    
    }
}
